import { useAuth } from "../../context.js/AuthContext";

function AllProducts(){
    return(
        <div className="page-container">
        <div className="content-wrap">
            <div>
                <Navbar/>
                <Footer/>
            </div>
        </div>
    </div>
    )
}

export default AllProducts
